import React from 'react'
import {useNavigate} from 'react-router-dom';

const Intro = () => {
    const style = {
        "backgroundImage": `url("images/bgimg2.jpg")`,
        "backgroundRepeat": "no-repeat",
        "backgroundSize": "cover",
        position: "absolute",
        height: "100%",
        width: "100%",
        text : "Welcome"
    }
    const header = {
        fontsize: "80px",
        color: "#363030",
        TextTrackList: "center"
    }

    const navigate = useNavigate();

    const navigateLogin=()=>{
        console.log("Login Page");
        navigate('/login');
    }

    const navigateSignup=()=>{
        console.log("Signup Page");
        navigate('/signup');
    }
    return(
        <>
          <div style={style}> 
          <h1 style={header}>Welcome to the Medicare. An online medicines seller</h1>
          </div>
        <ul className="container">
                <li><button type="button" className="btn btn-info mx-2 my-2" onClick={navigateLogin}>Login</button></li> 
                <li><button type="button" className="btn btn-info mx-2 my-2" onClick={navigateSignup}>Signup</button></li>
        </ul>
        </>
    ) 
}
    function HomePage() {
        return <div>
            <Intro />
        </div>
    }


export default HomePage
